import { useNavigate } from 'react-router-dom';
import DetailedVideoContent from './DetailedVideoContent';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'

const Video = (props) => {
    //const navigate = useNavigate();
    const video_url  = props.video_url;

    const handleClick = () => {
     // navigate("/DetailedVideoContent")     
    }

    return (
      <div className="videoContent">
        <div className="videoUpperContent">
          <video width="558" height="290" controls>
            <source type="video/mp4" src={video_url}></source>
          </video>
        </div>

        <div className="videoLowerContent">
          <button id='view-VideoDetails' onClick={handleClick.bind(this)}>View Details</button>  
        </div>  
      </div>
    )
}

export default Video

